    public static String[] getLinkName(String top, int len) {
        String result[] = new String[len];

        for (int i = 0; i < len; i++) {
            result[i] = top + (i + 1);
        }

        return result;
    }


    /*
     * 组合表单，这个表单有时间，园区对应的前缀表单
     * */
    public static String[] getElecInfo(String drxiaoqu, String txtRoomid,
                                       String drlou, int headid) throws ParseException, IOException {

        String info[] = new String[4];
        info[0] = info[1] = "null";
        if (drxiaoqu.equals("") || txtRoomid.equals("") || drlou.equals("")) {
            info[0] = info[1] = "null";
            return info;
        }

        SimpleDateFormat df1 = new SimpleDateFormat("MM/dd/yyyy:MM/dd/yyyy");
        SimpleDateFormat df2 = new SimpleDateFormat("yyyy年MM月dd日");
        Date date;

        // drxiaoqu = "26";
        // txtRoomid = "26010401";
        // drlou = "芙蓉1";

        // 昨日
        String dxdateStart = df2.format(System.currentTimeMillis() - 1000
                * 60 * 60 * 24);// 年月日
        date = df2.parse(dxdateStart);
        String dxdateStart_Raw = date.getTime() + "";// 时间戳
        String dxdateStart_DDD_C = df1.format(System.currentTimeMillis()
                - 1000 * 60 * 60 * 24)
                + "";
        // 今日
        String dxdateEnd = df2.format(System.currentTimeMillis());// 年月日
        date = df2.parse(dxdateEnd);
        String dxdateEnd_Raw = date.getTime() + "";
        String dxdateEnd_DDD_C = df1.format(System.currentTimeMillis())
                + "";

			/*
             * 这个分析一下它提交的表单具体内容就明白下面都是什么意思了
			 * 对应园区，园区的楼，宿舍号，查询的开始时间戳，查询的开始时间，开始的时间（单位是秒），结束时间戳，结束时间，结束时间（单位是秒）
			 * */
        String[] setdata = {drxiaoqu, drlou, txtRoomid, dxdateStart_Raw,
                dxdateStart, dxdateStart_DDD_C, dxdateEnd_Raw, dxdateEnd,
                dxdateEnd_DDD_C};

        String result;
        result = readContentFromPost(
                sendGet("http://elec.xmu.edu.cn/PdmlWebSetup/Pages/SMSMain.aspx",
                        ""), setdata, headid);

        info = result.split("：| |:");
        if (info.length < 4) {
            info = new String[4];
            info[0] = info[1] = "null";
            return info;
        }
        info[0] = info[1];
        info[1] = info[3];
        return info;
    }

    // 先get提取一次cookie
    public static String sendGet(String url, String param) {
        String result = "";
        String cookie = "";
        BufferedReader in = null;
        try {
            String urlNameString = url + "?" + param;
            URL realUrl = new URL(urlNameString);
            // 打开和URL之间的连接
            URLConnection connection = realUrl.openConnection();
            // 设置通用的请求属性
            connection.setRequestProperty("accept", "*/*");
            connection.setRequestProperty("connection", "Keep-Alive");
            connection.setRequestProperty("user-agent",
                    "Mozilla/4.0 (compatible; MSIE 6.0; Windows NT 5.1;SV1)");
            // 建立实际的连接
            connection.connect();

            cookie = connection.getHeaderField("Set-Cookie");
            String spcookie[] = cookie.split("=");
            spcookie = spcookie[1].split(";");
            cookie = spcookie[0];
            // 获取所有响应头字段
            Map<String, List<String>> map = connection.getHeaderFields();

        } catch (Exception e) {
            System.out.println("发送GET请求出现异常！" + e);
            e.printStackTrace();
        }
        // 使用finally块来关闭输入流
        finally {
            try {
                if (in != null) {
                    in.close();
                }
            } catch (Exception e2) {
                e2.printStackTrace();
            }
        }
        return cookie;
    }

    // POST提取电费
    public static String readContentFromPost(String cookie, String[] setdata,
                                             int headid) throws IOException {
        URL postUrl = new URL(
                "http://elec.xmu.edu.cn/PdmlWebSetup/Pages/SMSMain.aspx");
        HttpURLConnection connection = (HttpURLConnection) postUrl
                .openConnection();

        connection.setDoOutput(true);
        connection.setDoInput(true);
        connection.setRequestMethod("POST");

        // 取消缓存
        connection.setUseCaches(false);

        // 自动处理重定向
        connection.setInstanceFollowRedirects(true);

        connection.setRequestProperty("user-agent", "Mozilla/5.0");
        connection.setRequestProperty("Content-Type",
                "application/x-www-form-urlencoded");
        connection.setRequestProperty("Cookie", "ASP.NET_SessionId=" + cookie
                + "; path=/; HttpOnly");

        connection.connect();
        DataOutputStream out = new DataOutputStream(
                connection.getOutputStream());

        String data = post_info(setdata, headid);
        out.writeBytes(data);

        out.flush();
        out.close();

        BufferedReader reader = new BufferedReader(new InputStreamReader(
                connection.getInputStream(), "utf-8"));
        String line;
        String result = "";
        while ((line = reader.readLine()) != null) {
            result += line;
        }


		/*
         * 正则要抓的电费
		 * */
        Document doc = Jsoup.parse(result);
        org.jsoup.nodes.Element e = doc.getElementById("lableft");
        Elements es = e.getElementsByTag("label");
        result = "";
        for (org.jsoup.nodes.Element link : es) {
            result += link.text();
        }

        reader.close();
        connection.disconnect();
        return result;
    }

